const API_KEY = "504b85f6fe0a10a9c7f35945e14e7ddf";

const requests = {
  fetchTrending: `/trending?page=1`,
  fetchNetflixOriginals: `/discover/tv?api_key=${API_KEY}&with_network=123`,
  fetchTopRated: `/top-rate?page=1`,
  fetchActionMovies: `/discover?genreId=28`,
  fetchComedyMovies: `/discover?gerneId=35`,
  fetchHorrorMovies: `/discover?gerneId=27`,
  fetchRomanceMovies: `/discover?gerneId=10749`,
  fetchDocumentaries: `/discover?gerneId=99`,
  fetchSearch: `/search/movie?api_key=${API_KEY}&language=en-US`,
};

export default requests;
